INSERT INTO `micro-sd-32gb` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (1, '../img/products/Micro-SD-32GB/Kootion Micro SD Karte 32GB.webp;', 'Kootion Micro SD Karte 32GB', 'https://www.amazon.de/Kootion-2er-Pack-Speicherkarte-Memory-Klasse/dp/B07WLY8WHP/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=3HLA9LCZKUF3&keywords=Kootion+Micro+SD+Karte+32GB&qid=1667221696&qu=eyJxc2MiOiIwLjAwIiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=%2Caps%2C134&sr=8-3', '13,99', 4.5, 5304, 1, 'Kootion;Micro SDHC;64 GB;▲Breite Anwendung - KOOTION Micro SD-Karte ist ideal für Android Smartphones, Tablets, Digitalkameras, Spielekonsolen, Dash - Kameras, Drohnen und Überwachungssysteme usw; Es kann verwendet werden, um hochauflösende Fotos, Videos, Dokumente, Musik und mehr zu speichern oder zu sichern.|▲High Speed - Der 32GB Micro SD Karte mit Übertragungsgeschwindigkeit bis zu 85 MB/s, Lesegeschwindigkeit bis zu 20 MB/s, nimmt Geschwindigkeitsklasse UHS-I (U1) und Klasse 10 (C10) an, kann unterstützt Full-HD-Videoaufzeichnung.|▲Zuverlässigkeit &amp; Sicherheit - Hohe Sicherheit sd speicherkarte für Ihre Daten Eigenschaften wasserbeständig, anti-magnetisch, stoßfest, hoch- oder niedertemperaturbeständig und schützt die Daten stets.|▲Erweitern Sie den Speicher - Die MicroSD Speicherkarte kann Ihren Geräten zusätzliche Kapazität hinzufügen,Geben Sie den Speicherplatz für die Geräte frei, ermöglichen das reibungslose Funktionieren des Smartphones,Sparen Sie Geld, indem Sie kein Telefon mit hoher Kapazität kaufen.|▲Qualität und Service - Das paket enthält 2 micro SD karten 32GB und 1 adapter (Bei Fragen senden Sie bitte eine E-Mail)');
INSERT INTO `micro-sd-32gb` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (2, '../img/products/Micro-SD-32GB/Toshiba EXCERIA M302-EA.webp;', 'Toshiba EXCERIA M302-EA', 'https://www.amazon.de/Toshiba-EXCERIA-M302-EA-Speicherkarte-microSD/dp/B01EAKAUUK/ref=sr_1_2?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=135UUZRBP077R&keywords=Toshiba+EXCERIA+M302-EA&qid=1667221704&sprefix=toshiba+exce%2Caps%2C98&sr=8-2', '22,81', 4.6, 4517, 3, 'Toshiba;Micro SDXC;128 GB;Speziell für 4K-/Full-HD-Aufzeichnungen; Geeignet für Smartphones|Geeignet für extreme Umgebungsbedingungen|UHS-I-Schnittstelle, Geschwindigkeitsklasse 3 (U3); 128 GB: Geschwindigkeitsklasse 1 (U1); Klasse 10|Max. Lesegeschwindigkeit: 90 MB/s; Wasserfest IPX7, Röntgensicher (ISO7816-1); Stoßfest; Mit SD-Kartenadapter|Lieferumfang: Toshiba EXCERIA M302-EA Micro SDHC 128GB UHS-I Klasse 10 Speicherkarte (bis zu 90MB/s lesen)|Prüfen Sie, vor dem Kauf ob Ihr Gerät kompatibel ist');
INSERT INTO `micro-sd-32gb` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (3, '../img/products/Micro-SD-32GB/TOPESEL SD-Karte.webp;', 'TOPESEL SD-Karte', 'https://www.amazon.de/sspa/click?ie=UTF8&spc=MTo4NjE5MTI5NDAxNzAwMzExOjE2NjcyMjE3MTI6c3BfYXRmOjIwMDI2MjQ1MDc1NTA4OjowOjo&sp_csd=d2lkZ2V0TmFtZT1zcF9hdGY&url=%2FTOPESEL-SD-Karte-MicroSD-Speicherkarte-Samsung%2Fdp%2FB07Z3C6L24%2Fref%3Dsr_1_1_sspa%3F__mk_de_DE%3D%25C3%2585M%25C3%2585%25C5%25BD%25C3%2595%25C3%2591%26crid%3D16KUD6DWSPKWR%26keywords%3DTOPESEL%2BSD-Karte%26qid%3D1667221712%26sprefix%3D%252Caps%252C71%26sr%3D8-1-spons%26psc%3D1', '8,99', 4.5, 1310, 0, 'TOPESEL;SDHC;32 GB;[ High Speed ] Micro SD-Karte 32 GB.sd karte 32gb Lesegeschwindigkeit bis zu 85 MB/s, Schreibgeschwindigkeit 20 MB/s. (Die Leistung kann je nach Hostgerät, Schnittstelle, Nutzungsbedingungen und anderen Faktoren variieren.)|[ Full HD ] Mit Klasse 10(C10), UHS-1(U1) für Full HD-Videoaufnahmen, hochauflösende Fotos, Spiele und Musik usw. ermöglicht es Ihnen, jederzeit und überall wertvolle Momente festzuhalten.|[ Breite Kompatibilität ] Plug and Play. Perfekt für Handys, Tablets, Kameras, Spielekonsolen, Drohnen und Überwachungssysteme usw., um die Leistung zu verbessern und die Kapazität Ihrer verschiedenen Mobilgeräte zu erweitern.|[ Langlebig ] Spritzfest, stoßfest, antimagnetisch, röntgensicher, temperaturbeständig - bewahren Sie Ihre Daten immer sicher auf.|[ Garantie und Service ] 2 Jahre Garantie und kostenloser Ersatz oder Rückerstattung für Qualitätsprobleme. Bitte kontaktieren Sie den Verkäufer jederzeit per Amazon-Nachricht.');
INSERT INTO `micro-sd-32gb` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (4, '../img/products/Micro-SD-32GB/KEXIN 32GB Micro SD Karte.webp;', 'KEXIN 32GB Micro SD Karte', 'https://www.amazon.de/KEXIN-Speicherkarte-Smartphones-Autokamera-Sicherheitssystem/dp/B08JXK8S2Z/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=9M2RW25GFQI6&keywords=KEXIN+32GB+Micro+SD+Karte&qid=1667221718&sprefix=kexin+32gb+mi%2Caps%2C96&sr=8-3', '33,99', 4.5, 2920, 0, 'KEXIN;Memory Stick;32 GB;【High Speed】: Die Micro SD Karte unterstützt die UHS-1 Schnittstelle, geschwindigkeit klasse 10,U1. Lesegeschwindigkeit bis zu 80 MB/s, Schreibgeschwindigkeit 20 MB/s (Basierend auf internen Tests; Leistung kann je nach Hostgerät, Schnittstelle, Nutzungsbedingungen und anderen Faktoren geringer sein.), Format FAT32.|【Weit Verbreitete Anwendung】: Die microSDHC Karte ist hochkompatibel für verschiedene Gerätetypen, einschließlich Smartphones, Tablets, Drohnen, Android-Tablets, Tablet-PCs, Action-Kameras, Nintendo Switch, Sicherheitssystem und Full HD-Camcorder.|【Langlebig und Zuverlässig】: Die KEXIN Micro SD Karte wurde auf extreme Bedingungen getestet. Die Speicherkarte ist stoßfest, wasserdicht, temperaturbeständig, röntgenbeständig und magnetisch.|【Große Kapazität】: 5 x 32 GB MicroSD Karte (verfügbare Kapazität beträgt ca. 29.44 GB). Machen Sie frei und erhöhen Sie die Kapazität Ihrer Geräte. Ideal zum Speichern Ihrer Fotos, Vedios und Musik.|【Kompakt und praktisch】: Die KEXIN micro SD speicherkarte ist klein genug, um sie überall hin mitnehmen zu können. So können Sie den Reichtum des Lebens retten und schätzen. Sie können 5 x 32 GB Micro SD Karten + 1 x Kartenadapter erhalten.');
INSERT INTO `micro-sd-32gb` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (5, '../img/products/Micro-SD-32GB/Verbatim Premium 32 GB.webp;', 'Verbatim Premium 32 GB', 'https://www.amazon.de/Verbatim-43963-SecureDigital-Class-SDHC-Karte/dp/B0050OFC5E/ref=sr_1_4?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=2RBI8BIJ9CR1D&keywords=verbatim+premium+32gb&qid=1667221726&qu=eyJxc2MiOiIwLjAwIiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=hephinov+micro-sd-32gb%2Caps%2C81&sr=8-4', '9,57', 4.5, 991, 0, 'Verbatim;SDHC;32 GB;OPTIMALE AUFLÖSUNG: Die Speicherkarte überzeugt dank Leistungsklasse 10 mit einer Datenübertragsrate von mind. 80 Mbit/s - sie ermöglicht es Ihnen, Full-HD-Videos aufzunehmen.|SCHNELLE ÜBERTRAGUNG: Mit der SD-Karte profitieren Sie von sehr kurzen Übertragungszeiten Ihrer Dateien - dank einer Lesegeschwindigkeit von bis zu 90 MB/s &amp; Schreibgeschwindigkeit von mind. 10 MB/s.|VIELSEITIGE EINSATZGEBIETE: Die SDHC-Speicherkarte ist mit jedem elektronischen Gerät bspw. PC &amp; Kamera kompatibel, dass einen Einschub für die SDHC/SDXC-Speicherkarte besitzt.|PRODUKTDETAILS: Die Speicherkarte von Verbatim ist in den Ausführungen 16 GB , 32 GB , 64 GB, 128 GB und 256 GB erhältlich - sie ist kompatibel mit Kameras &amp; Hostgeräten, die SDXC unterstützen.|Verbatim: Mit unserer jahrelangen Erfahrung stehen wir für genaue &amp; fehlerfreie Datenspeicherung - Unsere Stärken in den Bereichen F&amp;E und Qualitätssicherung garantieren erstklassige Produkte!');
INSERT INTO `micro-sd-32gb` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (6, '../img/products/Micro-SD-32GB/Hama microSDHC 32GB.webp;', 'Hama microSDHC 32GB', 'https://www.amazon.de/Hama-microSDHC-Class-UHS-I-Adapter/dp/B017JY4SOI/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=28MDAASV52HFQ&keywords=Hama+microSDHC+32GB&qid=1667221732&qu=eyJxc2MiOiIwLjAwIiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=%2Caps%2C64&sr=8-3', '8,49', 4.6, 788, 0, 'Hama;Micro SDHC;32 GB;Beliebig oft beschreib- und löschbares Wechselspeichermedium|Für Real-time/Broadcast-Aufnahmen, ermöglicht schnelle und direkte Datenübertragung zwischen Speicherkarte und UHS-I-fähigem Endgerät, micro SecureDigital Extended Capacity Card (microSDXC), entspricht neuem SD-3.01-Standard|Besonders geeignet für Real-time Full-HD-Video- und 3D-Videoaufnahmen|Inkl. Adapter auf SD-Kartenformat, nur geeignet für Endgeräte mit microSDHC-Steckplatz (nicht abwärtskompatibel zu microSD-Cards).|Lieferumfang: 1 microSDHC-Karte, 1 SD-Adapter');
INSERT INTO `micro-sd-32gb` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (7, '../img/products/Micro-SD-32GB/Transcend Highspeed 32GB .webp;', 'Transcend Highspeed 32GB ', 'https://www.amazon.de/Transcend-Speicherkarte-TS32GSDC300S-umweltfreundliche-Verpackung/dp/B07DVJGYF4/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=3EC3ZKW6XZVLP&keywords=Transcend+Highspeed+32GB&qid=1667221737&qu=eyJxc2MiOiIwLjAwIiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=tr%2Caps%2C101&sr=8-3', '9,37', 4.6, 23615, 0, 'Transcend;SDHC;32 GB;Kompatibel mit UHS-I U1, Class 10|32GB Speicherkapazität. Betriebstemperatur: -25 ° C (-13 ° F) ~ 85 ° C (185 ° F)|Bis zu 95 MB/s Lesen; 45 MB/s Schreiben|Ideal für Digitalkameras für die tägliche Aufzeichnung|Perfekt für ein ruhiges und ungestörtes 4K Video Erlebnis, getestet, um extremen Bedingungen zu widerstehen');
