INSERT INTO `micro-sd-32gb` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (7, '../img/products/Micro-SD-32GB/Transcend Highspeed 32GB .webp;', 'Transcend Highspeed 32GB ', 'https://www.amazon.de/Transcend-Speicherkarte-TS32GSDC300S-umweltfreundliche-Verpackung/dp/B07DVJGYF4/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=3BGBFQLNNP84O&keywords=transcend+high+speed+32gb&qid=1667645144&qu=eyJxc2MiOiIxLjQwIiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=%2Caps%2C73&sr=8-3', '8,99', 4.6, 23649, 0, 'Transcend;SDHC;32 GB;Kompatibel mit UHS-I U1, Class 10|32GB Speicherkapazität. Betriebstemperatur: -25 ° C (-13 ° F) ~ 85 ° C (185 ° F)|Bis zu 95 MB/s Lesen; 45 MB/s Schreiben|Ideal für Digitalkameras für die tägliche Aufzeichnung|Perfekt für ein ruhiges und ungestörtes 4K Video Erlebnis, getestet, um extremen Bedingungen zu widerstehen');
